fields.formula:
concat( 
  "Q", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

join( 
  if( 
    or( 
      trunc(tonumber(right(totext(field("Question ID")), 1))) = 1, 
      trunc(tonumber(right(totext(field("Question ID")), 1))) = 6 
    ), 
    "S", 
    if( 
      or( 
        trunc(tonumber(right(totext(field("Question ID")), 1))) = 2, 
        trunc(tonumber(right(totext(field("Question ID")), 1))) = 7 
      ), 
      "Y", 
      if( 
        or( 
          trunc(tonumber(right(totext(field("Question ID")), 1))) = 3, 
          trunc(tonumber(right(totext(field("Question ID")), 1))) = 8 
        ), 
        "G", 
        if( 
          or( 
            trunc(tonumber(right(totext(field("Question ID")), 1))) = 4, 
            trunc(tonumber(right(totext(field("Question ID")), 1))) = 9 
          ), 
          "R", 
          "B" 
        ) 
      ) 
    ) 
  ), 
  "" 
)
